import React from "react";
import "../styles/ourWorks.css";
import Work1 from"../resource/work1.jpg"
import Work2 from"../resource/work2.jpg"
import Work3 from"../resource/work3.jpg"
import {worksContentData} from "../actions/worksAC";
import {connect} from "react-redux";
class OurWorks extends React.Component{
    componentDidMount() {
        this.props.fetchData("http://localhost/backend/works.php");
    }
    render(){
        let OurWorks = this.props.works.map((data, index) => {
            return (
                <div key={index} className="work">
                    <img src={data.img} alt="img"/>
                    <div className="workInfo">
                        <h4>{data.name}</h4>
                        <h6>{data.context}</h6>
                    </div>
                </div>
            )
        })
    return (
        <div className="worksContent">
            <h1>{this.props.title.workTitle?this.props.title.workTitle['title']:""}</h1>
            <div className="worksContext">
                <hr/>
                <h6>{this.props.title.workTitle?this.props.title.workTitle['context']:""}</h6>
                <hr/>
            </div>
            <div className="workList">
                {OurWorks}
            </div>
            <button>OurWorks</button>
        </div>
    )}
}
const mapStateToProps = state => ({
    works: state.works,
    title: state.header
});

const mapDispatchToProps = dispatch => ({
    fetchData: url => dispatch(worksContentData(url))
});
export default connect(mapStateToProps, mapDispatchToProps)(OurWorks)
